    n = 0
    while True:
        total_length = 1 + n * (n + 1) // 2
        if total_length >= k:
            break
        n += 1

    segment_index = k - (1 + n * (n - 1) // 2) - 1
    char_position = segment_index % n
    return chr(ord('a') + char_position)

def get_kth_character(k):
    # Find the smallest power of 2 such that 2^n - 1 >= k
    n = 1
    while (1 << n) - 1 < k:
        n += 1

    # Calculate the position of k within the last appended string
    position_in_last_string = k - ((1 << (n - 1)) - 1)

    # Convert the character at that position to its next lexicographical character
    return chr((position_in_last_string + ord('a') - 1) % 26 + ord('a'))

